import React, { useRef, useEffect } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  Animated,
  Dimensions,
  Platform,
  Linking
} from 'react-native';

const { width, height } = Dimensions.get('window');

const HeroSection = ({ onCTAPress }) => {
  const fireAnim = useRef(new Animated.Value(0)).current;
  const scaleAnim = useRef(new Animated.Value(1)).current;
  const fadeAnim = useRef(new Animated.Value(0)).current;
  const particleAnims = useRef([...Array(20)].map(() => new Animated.Value(0))).current;

  useEffect(() => {
    Animated.timing(fadeAnim, {
      toValue: 1,
      duration: 1500,
      useNativeDriver: true,
    }).start();

    particleAnims.forEach((anim, index) => {
      Animated.loop(
        Animated.sequence([
          Animated.delay(index * 100),
          Animated.timing(anim, {
            toValue: 1,
            duration: 3000,
            useNativeDriver: true,
          }),
          Animated.timing(anim, {
            toValue: 0,
            duration: 0,
            useNativeDriver: true,
          }),
        ])
      ).start();
    });
  }, [fadeAnim, fireAnim, scaleAnim, particleAnims]);

  const handleCTAPress = () => {
    Linking.openURL('https://calendly.com/zappstudios');
  };

  return (
    <View style={styles.container}>
      <Animated.View style={[styles.content, { opacity: fadeAnim }]}>
        <Text style={styles.headline}>
          ZAPP STUDIOS
        </Text>

        <View style={styles.subtitleContainer}>
          <Text style={styles.subtitle}>
            Rapid MVP & POC Development for Startups
          </Text>
        </View>

        <Text style={styles.tagline}>
          Bringing your startup idea to life with a powerful blend of computer science and business expertise, delivering a product that provides real value and drives revenue.
        </Text>

        <TouchableOpacity
          style={styles.ctaButton}
          onPress={handleCTAPress}
          activeOpacity={0.8}
        >
          <Text style={styles.ctaButtonText}>BOOK A STRATEGY CALL</Text>
        </TouchableOpacity>

        <View style={styles.scrollIndicator}>
          <Animated.View style={[styles.scrollDot, { transform: [{ translateY: fireAnim.interpolate({
            inputRange: [0, 1],
            outputRange: [0, 10]
          }) }] }]} />
          <Text style={styles.scrollText}>SCROLL TO EXPLORE</Text>
        </View>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    width: width,
    minHeight: height,
    justifyContent: 'center',
    alignItems: 'center',
    position: 'relative',
    paddingTop: 80,
    backgroundColor: '#F5F5F5',
  },
  content: {
    alignItems: 'center',
    paddingHorizontal: 20,
    zIndex: 1,
  },
  headline: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 64 : 36,
    fontWeight: '700',
    color: '#1A1A1A',
    textAlign: 'center',
    marginBottom: 20,
  },
  subtitleContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 20,
  },
  subtitle: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 28 : 20,
    fontWeight: '600',
    color: '#00A8E8',
    textAlign: 'center',
  },
  tagline: {
    fontFamily: Platform.OS === 'web' ? "'Roboto', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 14,
    color: '#333333',
    textAlign: 'center',
    marginBottom: 40,
    maxWidth: width > 768 ? 600 : width * 0.9,
    lineHeight: 28,
  },
  ctaButton: {
    backgroundColor: '#00A8E8',
    paddingVertical: 20,
    paddingHorizontal: 40,
    borderRadius: 8,
    marginBottom: 60,
  },
  ctaButtonText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 12,
    color: '#FFFFFF',
    fontWeight: '700',
    letterSpacing: 1,
  },
  scrollIndicator: {
    alignItems: 'center',
    position: 'absolute',
    bottom: 30,
  },
  scrollDot: {
    width: 8,
    height: 8,
    backgroundColor: '#00A8E8',
    borderRadius: 4,
    marginBottom: 10,
  },
  scrollText: {
    fontFamily: Platform.OS === 'web' ? "'Montserrat', sans-serif" : 'sans-serif',
    fontSize: 12,
    color: '#1A1A1A',
    opacity: 0.6,
    letterSpacing: 2,
  },
});

export default HeroSection;
